TITULAR DE LA SECRETARÍA
- LLEVAR A CABO LA SINDICALIZACIÓN DE LOS COMPAÑEROS ANTE GOBIERNO DEL ESTADO DE ACUERDO A LO ESTABLECIDO POR EL COVENIO DE PRESTACIONES;
- OBTENER EL EXPEDIENTE DE LOS AGREMIADOS;
- DIGITALIZACIÓN Y RESGUARDO DE LOS EXPEDIENTES DE LOS COMPAÑEROS AGREMIADOS;
- EXPEDIR LA CREDENCIAL DEL GREMIO;
- SOLICITAR ANTE EL OSFEM LA HOJA DE SERVICIO QUE REQUIEREN LOS COMPAÑEROS;
- SOLICITAR ANTE CONTROL DE PAGOS DE GOBIERNO DEL ESTADO EL HISTÓRICO LABORAL DE QUEIN LO REQUIERA;
- EXPEDIR CONSTANCIAS DE PERMANENCIA;
- EXPEDIR CONSTANCIAS POR ANTIGUEDAD SINDICAL;
- DAR SEGUIMIENTO A LAS CARTAS TESTAMENTARIAS;
- ELABORAR EL INFORME ANUAL DEL ÁREA; Y
DEMÁS ASUNTOS QUE CONFIERAN LOS ESTATUTOS Y LA ASAMBLEA GENERAL ESTATAL.

